export default function MainBanner(){
    return(
        <div className="presentation">
            <div className="subTitle1">
                <h2>Olá, meu nome é Filipe</h2>
            </div>
            <div classname="mainTitle">
                <h1>React</h1>
                <h1>Developer</h1>
            </div>
        </div>
    );
}
